import React from 'react';
import { Link } from 'react-router-dom'; // Make sure you have react-router-dom installed
import './Logo.css';

const Logo = () => {
  return (
    <div className="logo-container">
      <Link to="/" className="logo-link">
        <div className="logo-text">Repute</div>
      </Link>
    </div>
  );
};

export default Logo;
